If expressions allow you to conditionally evaluate code based on whether or not some condition is met. my_var = 10
if my_var =? 10 { printl("my_var is ten")
} If statements require the expression to be a boolean value. Any other type will result in a compilation error. If the first condition is false, you can use an else clause to execute something else instead my_var = 'apple'
if my_var =? 'banana' { printl('A fruit enjoyed by monkies')
}
else
{ printl('monkies don\'t like {my_var}, only bananas!')
} You can also nest multiple conditions using else if my_var = 42
if my_var <=? 10
{ printl('a small number')
}
else if my_var <=? 50
{ printl('a medium number')
}
else
{ printl('a number larger than 50')
} Unlike if statements from other languages, ifs in Dewy are expressions, allowing them to be used like the ternary operator from other languages my_fruit = 'kiwi'
tropical_fruits = ['banana' 'pineapple' 'kiwi' 'papaya']
my_var = if my_fruit in? tropical_fruit
{ 'a tropical fruit'
}
else
{ 'some other type of fruit'
} my_var would have a value of 'a tropical fruit' at the end of the above example.

