All loop behavior is handled with the loop keyword. It is capable of performing every other type of loop, including while, for, do-while, and infinite loops from other languages. Basic examples of loops loop { printl('this is an infinite loop')
} i = 0
loop my_var <? 10
{ i += 1 printl('this is a while loop')
} loop i in 0:10
{ printl('this is a for loop')
} The do-while version of the loop can be constructed by putting the loop keyword after the block to loop. This can also be performed with for and infinite versions of the loop. In each case, the loop body is executed once before the condition is checked. The syntax is still slightly TBD--currently this is the only syntax in the language that relies on whitespace to determine what the user intends i = 0
{ i += 1 printl('this is a do-while loop')
}
loop i <? 20 { printl('this is a do-for loop')
}
loop i in 0:10 { printl('this is a do-infinite loop')
}
loop Lastly you can combine the normal loop with the do form of the loop. This will give you a block executed before the condition and a block executed after the condition i = 0
{ printl('before condition is checked')
}
loop i <? 20
{ printl('after condition is checked') i += 1
}

